      "DescribeBackupsResponse": {
        "type": "object",
        "properties": {
          "Backups": {
            "allOf": [
              { "$ref": "#/components/schemas/Backups" },
              { "description": "A list of backups." }
            ]
          },
          "NextToken": {
            "allOf": [
              { "$ref": "#/components/schemas/NextToken" },
              {
                "description": "An opaque string that indicates that the response contains only a subset of backups. Use this value in a subsequent <code>DescribeBackups</code> request to get more backups."
              }
            ]
          }
        }
      },
      "DescribeBackupsRequest": {
        "type": "object",
        "title": "DescribeBackupsRequest",
        "properties": {
          "NextToken": {
            "allOf": [
              { "$ref": "#/components/schemas/NextToken" },
              {
                "description": "The <code>NextToken</code> value that you received in the previous response. Use this value to get more backups."
              }
            ]
          },
          "MaxResults": {
            "allOf": [
              { "$ref": "#/components/schemas/MaxSize" },
              {
                "description": "The maximum number of backups to return in the response. When there are more backups than the number you specify, the response contains a <code>NextToken</code> value."
              }
            ]
          },
          "Filters": {
            "allOf": [
              { "$ref": "#/components/schemas/Filters" },
              {
                "description": "<p>One or more filters to limit the items returned in the response.</p> <p>Use the <code>backupIds</code> filter to return only the specified backups. Specify backups by their backup identifier (ID).</p> <p>Use the <code>sourceBackupIds</code> filter to return only the backups created from a source backup. The <code>sourceBackupID</code> of a source backup is returned by the <a>CopyBackupToRegion</a> operation.</p> <p>Use the <code>clusterIds</code> filter to return only the backups for the specified clusters. Specify clusters by their cluster identifier (ID).</p> <p>Use the <code>states</code> filter to return only backups that match the specified state.</p>"
              }
            ]
          },
          "SortAscending": {
            "allOf": [
              { "$ref": "#/components/schemas/Boolean" },
              {
                "description": "Designates whether or not to sort the return backups by ascending chronological order of generation."
              }
            ]
          }
        }
      },
      "DescribeClustersResponse": {
        "type": "object",
        "properties": {
          "Clusters": {
            "allOf": [
              { "$ref": "#/components/schemas/Clusters" },
